import React, { Component } from 'react'
import { Field, reduxForm } from 'redux-form'

class PostsNew extends Component {
  render () {
    return (<h2>Hello, create a new post here</h2>)
  }
}

export default reduxForm({
  form: 'PostsNewForm'
})(PostsNew)
